        <header className=''>
            <div className=''>
                <a className='Oswald400 green' href="#!">zakaz@loverflower.by</a>
                <h2 className='Oswald300 gray'>zakaz@loverflower.by</h2>
                <Medias />
            </div>
        </header>
    );
};

export default Header;
